import './Home.css';


function Home(){
    return (
        <>
           <Paper>
                <Box p={2}>
                    <Box display="flex" justifyContent="center">
                        <h1>TÃ­tulo</h1>
                    </Box>
                    <img src="https://mentorama.com.br/blog/wp-content/uploads/2021/12/capa-web_dev-blog-mentorama-1536x525.jpg" alt=" imagem" style={{ width: "100%", height: "100%"}} />
                    <Box display="flex" justifyContent="center" p={2}>
                        <Button variant="contained" color="primary" justi>Texto 1</Button>
                        <Button variant="contained" color="secondary">Texto 2</Button>
                    </Box>     
                </Box>
           </Paper>
        </>
    );
}

export default Home;
